description:
Bingo, ailesinin en küçüğü ve en sevimlisiydi. Ona herkes “Uzun Burun” diyordu. Neden mi? Çünkü çok ama çok uzun bir hortumu vardı. O, dünyanın en uzun hortumlu filiydi! Bingo, burnu nedeniyle biraz üzülüyor, diğer fillerden farklı olduğu için rahatsızlık duyuyordu. Ancak bir gün arkadaşlarıyla birlikte oynamaya gittikleri şelaleden hiç su akmadığını görünce iş Uzun Burun’a düşecekti!“Kitap Cadısı” Burcu Bahar, sizler için çok eğlenceli bir öykü yazdı. Kitabın sonundaki soruları çözer, tekerlemeyi söylerseniz sihirli bir dünyanın kapısı sizler için açılacak!    

